import React from "react";
import "../views/ServiceDetailCards.css";

const ServiceDetailCards = () => {
  return (
    <>
      <div style={{ display: "flex" }}>
        <li className="fa fa-check serviceIcon"></li>
        <p className="serviceHeading">Onu Invest</p>
      </div>
      <div>
        <p className="serviceDetails1">All Investment Choices in One Place</p>
        <p className="serviceDetails2">
          [Subscription Based access to Investment rates and much more]
        </p>
      </div>
    </>
  );
};

export default ServiceDetailCards;
